    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    }
  ];



  return (
    <div>
            <h1>Let's get started!</h1>
            NewExpense
      <Expense expenses={expenses}/>
    </div>

  );
}

export default App;
